import { HomeImage } from '../../assets/images/home.svg';
import Box from '@mui/material/Box';

export const Home = () => {

    return (
        <Box>
            <Header />
            <Box sx={{ display: 'flex' }}>
                <img src={HomeImage} alt='homeImage' />
            </Box>
        </Box>

    )
}
